import React from "react";
import styled from "styled-components";

const Dot = styled.div`
  background: #ccc;
  border-radius: 100%;
  display: block;
  height: 7px;
  margin-bottom: 3px;
  width: 7px;
`;
const Meter = styled.div`
  display: flex;
  flex-direction: column;
  position: absolute;
  right: 30px;
  top: 11px;

  ${Dot} {
    &:nth-child(4) {
      background: #dc3545;
    }
    &:nth-child(3) {
      background: ${({ strength }) => (strength > 1 ? "#efc974" : null)};
    }
    &:nth-child(2) {
      background: ${({ strength }) => (strength > 2 ? "#25A2B7" : null)};
    }
    &:nth-child(1) {
      background: ${({ strength }) => (strength > 3 ? "#4c9788" : null)};
    }
  }
`;

function PasswordStrengthIndicator({ strength }) {
  return (
    <Meter strength={strength}>
      <Dot />
      <Dot />
      <Dot />
      <Dot />
    </Meter>
  );
}

export default PasswordStrengthIndicator;
